import { Component } from 'react';
import './style.css';

class Socials extends Component{
    constructor(){
        super()
    }
render(){
    return(
        <div id='facebook' className='socials_container'>
            <div className='social_container'>
            <img src="https://img.icons8.com/ios/50/000000/twitter--v1.png"/>
            <div className='social_inner_container'>
                <h3>FOLLOW ME ON</h3>
                <p>SOCIAL FACEBOOK</p>
            </div>
            </div>
            <div  className='social_container'>
            <img src="https://img.icons8.com/?size=512&id=32309&format=png" />
            <div className='social_inner_container'>
                <h3>FOLLOW ME ON</h3>
                <p></p>
            </div>
            </div>
            <div className='social_container'>
            <img src="https://icons8.com/icon/437/twitter" />
            <div className='social_inner_container'>
                <h3>FOLLOW ME ON</h3>
                <p></p>
            </div>
            </div>
        </div>
    )
}
}
export default Socials;
